import React from "react";
import PropTypes from "prop-types";
import Link from "next/link";
import { Input, Menu, Row, Col } from "antd";
import "antd/dist/antd.css";

const AppLayout = (props) => {
  return (
    <div>
      <div>
        <Menu mode="horizontal">
          <Menu.Item>
            <Link href="/">
              <a>ShareThoughts</a>
            </Link>
          </Menu.Item>
          <Menu.Item>
            <Link href="/profile">
              <a>Profile</a>
            </Link>
          </Menu.Item>
          <Menu.Item>
            <Input.Search
              enterButton
              style={{ verticalAlign: "middle", background: "crimson", border: "none" }}
            />
          </Menu.Item>
          <Menu.Item>
            <Link href="/signup">
              <a>Sign Up</a>
            </Link>
          </Menu.Item>
        </Menu>
        <Row>
          <Col xs={24} sm={4} md={6} lg={4}>
            Left Section
          </Col>
          <Col xs={24} sm={16} md={12} lg={16}>
            {props.children}
          </Col>
          <Col xs={24} sm={4} md={6} lg={4}>
            Right Section
          </Col>
        </Row>
      </div>
    </div>
  );
};

AppLayout.propTypes = {
  children: PropTypes.node.isRequired, //node: nodejs의 node가 아닌 react의 node: 화면에 그릴 수 있는 모든 것(return안에 들어갈 수 있는 모든 것)
};

export default AppLayout;
